import React from "react";

function EmojiCard(props) {
  return (
    <div className="card">
      <h2>
        {props.name} {props.meaning}
      </h2>
      <hr />
      <p>{props.meaning}</p>
      <hr />
      <p>{props.emoji}</p>
    </div>
  );
}
export default EmojiCard;
